export const generateFakeTableData = ({
    count = 24,
    base = 5,
    range = 3,
    inter
}) => {
    const rows = [];

    for(let i = 1; i <= count; i++){
        const min = +(Math.random()*3 + 2).toFixed(2);
        const max = +(min + Math.random()*2 + 1).toFixed(2);
        const current = +(Math.random() * (max - min) + min).toFixed(2);
        const rate = +((current / max) * 100).toFixed(1);

        rows.push({
            no: i,
            current,
            min,
            max,
            rate,
            datetime: new Date(Date.now() - i * 60 * 60 * 1000).toLocaleString("ja-jp")
        })
    }
    return rows;
}
